* {
	scroll-behavior: smooth;
}
@font-face {
	font-family: 'regular';
	src: url("https://sqdldev.github.io/rolling-sky/fonts/sen/regular.ttf");
}
@font-face {
	font-family: 'bold';
	src: url("https://sqdldev.github.io/rolling-sky/fonts/sen/bold.ttf");
}
html {
    background: #000000;
	color: white;
	position: absolute;
    width: 100%;
    margin: 0;
	font-family: 'regular';
}
body {
    height: 100vh;
    margin: 0;
}
a {
	text-decoration: underline;
	color: #88beff;
}
div.container {
    display: flex;
    flex-direction: column;
    align-content: center;
    align-items: center;
    justify-content: center;
    flex-wrap: nowrap;
    width: 100%;
    height: 100%;
    position: relative;
    z-index: 64;
}
div.background {
    width: 100%;
    height: 100%;
    z-index: 0;
    position: absolute;
    left: 0;
    top: 0;
    background-image: var(--randomBg);
    background-position-x: center;
    background-position-y: 0;
    background-repeat: no-repeat;
    background-size: cover;
    opacity: 0.5;
    filter: blur(5px);
    -webkit-filter: blur(5px);
}
span {
    display: block;
    text-align: center;
    padding-left: 30px;
    padding-right: 30px;
    width: calc(100% - 60px);
    max-width: 700px;
    white-space: pre-line;
}
span.title {
    font-size: 32px;
    font-family: 'bold';
    margin-bottom: 10px;
}
span.paragraph {
    font-size: 20px;
    font-family: 'regular';
    margin-bottom: 20px;
}
</style>
</head>

<div class="background"></div>
<div class="container">
<span class="title" id="mainTitle">The page you are looking for does not exist</span>

<span class="paragraph">Sorry, the page you were looking for does not seem to exist. This page has likely been taken down. Visit <a href="https://sqdldev.github.io/">this</a> page for more info.</span>
</div>

<script>
var pagename = window.location.href.replace(/\/$/, '').split('/').slice(-1)[0].toUpperCase();

function randomInt(min, max) {
	return Math.floor(Math.random() * (max - min + 1) + min)
}

document.querySelector('#title').innerHTML = pagename;
document.querySelector('#mainTitle').innerHTML  = `The page "${pagename}" does not exist.`;

const randomNum = randomInt(1, 3);
document.querySelector(':root').style.setProperty('--randomBg', `var(--bg${randomNum})`);

</script>
</body>
</html>
